import React, { Component } from 'react';
import { Switch, Route,Link } from 'react-router-dom'


class Main extends Component {
    constructor(props) {
        super(props);
        this.state = {  };
    }
    render() {
        console.log(this.props)
        const { routers } = this.props
        return (
            <div>
                <Switch>
                    {
                        routers.map((router,index) =>{
                            return  <Link key={index} to={router.path} underlayColor="#f0f4f7" >
                                <Route key={index} component={router.component} />
                            </Link>

                        })
                    }
                </Switch>
            </div>
        );
    }
}
export default Main;
